import { useNavigate } from "react-router-dom";
import { TextField, Button, Box } from "@mui/material";

const Login: React.FC = () => {
    let navigate = useNavigate();
    return (
        <div className="Test">
            <header>
                <text>Test</text>
                <br/>
                <br/>
                <br/>
                <br/>
                <br/>
                <br/>
            </header>
            <text>Test de navigation</text>
            <Box
            component="form"
            sx={{
              '& .MuiTextField-root': { m: 1, width: '25ch' },
            }}
            noValidate
            autoComplete="off"
            >
            <TextField required id="username" label="Email" variant="outlined"/>
            <TextField required id="password" label="Password" variant="outlined"/>
            </Box>
            <button onClick={() => navigate("/test")}>Navigue i√ßi</button>

        </div>
    );
};

export default Login;
